import React from 'react';
import Navbar from "../components/Navbar";
import FetchMovies, {Movie} from "../components/FetchMovies";
import {Genre} from "../components/FetchGenres";

const Home = () => {

    let query:string;

    return (
        <>
            <Navbar query={query}/>
            <h1>Home</h1>
            <FetchMovies />
        </>
    );
};

export default Home;
